import { useSelector } from "react-redux";
import "./Mycalendar"

export default function MyCalendar(props){
    let array=[]
    if(props.intervalo.length>1){
    array=props.intervalo
    array=array.slice(1)
    }

    return(
        <div>
            
            <div className="text">
               {array.length>0&&array.map((e,i)=>{
                return <li  key={i}>{e.desde}/{e.hasta} dias: {e.dias.map((j,x)=>{return <span key={x}>{j.toUpperCase()}/</span> })}</li>
            
            })}
            </div>

        </div>
    )
}
